function App() {
  return (
    <div className='flex flex-col h-screen w-screen justify-center items-center'>
      <div className='flex'>
        <input
          placeholder='Search'
          className='w-80 h-10 border border-gray-500 rounded-lg bg-gray-200 indent-3'
        />
      </div>
    </div>
  );
}

export default App;
